import React from "react";
import { Modal } from "react-bootstrap";

function Profile(){
    const profile_icon = document.getElementById("profile_icon");
    const [showModal, updateModalState] = React.useState(false);
    const handleHideModal = ()=> updateModalState(false);
    const handleShowModal = (e)=> updateModalState(true);

    console.log(profile_icon)
    return(
        <>
            <img id="profile_icon" src='/images/profile.png' alt='profile icon' />
            <Modal show={showModal} onHide={handleHideModal}>
                <Modal.Header closeButton>
                    <img src="/images/favicon.png" alt="Website logo"/>
                    <Modal.Title>User Panel</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    <p>Example Text.</p>
                </Modal.Body>
            </Modal>
        </>
    );
}

export default Profile;
